import { Navigate, Route } from 'react-router-dom';
import { useAuth } from '../contexts/AuthContext';

export default function PrivateRoute({quiz: Quiz, ...rest}){
  const {currentUser} = useAuth();

  return currentUser ? (
    <Route {...rest}>{(props) => <Quiz {...props} />}</Route>
  ) : (
    <Navigate to='/login' />
  );
}
